        <div className='nav-bar'>
            <div className='nav-logo-area'>
                <img className="nav-logo" src={ReactLogo} alt="" />
                <h1 className='nav-heading'>React Facts</h1>
            </div>
            <h1>React Course - Project 1</h1>
        </div>
    )
}
